import { createIcon } from "../icon/createIcon";

export const TriangleRightDownIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="TriangleRightDownIcon">
    <path d="M9.571 2.5v7.071H2.5z" />
  </svg>,
  "TriangleRightDown",
  "triangle right down"
);
